    {
        id: 1,
        text: "Task 1",
        day: "Day 1",
        reminder: false,
    },
    {
        id: 2,
        text: "Task 2",
        day: "Day 2",
        reminder: false,
    },
  ])

  // Delete Task
  const deleteTask = (id) => {
    alert('hello')
  }

  return (
    <div className="container">
      <Header />
      <Tasks tasks={tasks} onDelete={deleteTask}/>
    </div>
  );
}

export default App;
